import React from 'react';
import Button from '@material-ui/core/Button';
import { useState} from 'react'

function Submit() {
  const [answer, setAnswer] = useState("")
  return (
    <Button className="btnSubmit" variant="contained" color="primary" disableElevation href="/" value={answer} onClick={(e) => setAnswer(e.target.value)}>
      Submit
    </Button>
  );
}
export default Submit;
